import React from 'react';
import {Card, Carousel} from "antd";

export default function Discover() {
    return (
        <>
            <Carousel>
                <div>1</div>
                <div>2</div>
                <div>3</div>
                <div>4</div>
            </Carousel>
        </>
    );
}
